import React from'react';




const Wind = props =>(
        <div className="weather__info" >
            <p className="weather__key"> Location:
             {
                props.city && props.country ? 
                 <span className="weather__value">{props.city}, {props.country}</span> : null
            }</p>

            <p className="weather__key"> Temperature:
            {
                props.temp ? 
                <span className="weather__value">{props.temp}Â°F</span> : null 

            }</p>

            <p className="weather__key"> Humidity: 
            {
                props.temp ? <span className="weather__value">{props.humidity}%</span> : null

            }</p>

            <p className="weather__key"> Description: 
            {
                props.temp ? 
                 <span className="weather__value">{props.description}</span>: null
            }</p>

            <p className="weather__key"> Wind: 
            {
                props.temp ? 
                 <span className="weather__value">{props.wind}mph</span>: null
            }</p>

            <p className="weather__key"> Head Wind will slow down by: 
            {
                props.temp ? 
                 <span className="weather__value">{props.effect} seconds per mile</span>: null
            }</p>
            <p className="weather__key"> Tail Wind will speed you up by: 
            {
                props.temp ? 
                 <span className="weather__value">{props.effect/2} seconds per mile</span>: null
            }</p>
            {
                props.error ? 
                <p className="weather__key"> Error: <span className="weather__value">{props.error}</span>
                </p> : null
            }

        </div>
    );

export default Wind;
